import ProductListing from '../../components/ProductListing/ProductListing.js';
import './HomePage.css';

function HomePage() {

  return (
    <>
        <div className='homepage'>
          <ProductListing 
            product={{
              name:'hej',
              price:99.99,
              yearOfProduction:'2022',
              color:'RED',
              condition: 'new'
            }}
          />
        </div>
    </>
  );
}

export default HomePage;
